export const actionTypes = {
    GET_ACTIVE_QUESTIONS_REQUEST: 'GET_ACTIVE_QUESTIONS_REQUEST',
    GET_ACTIVE_QUESTIONS_SUCCESS: 'GET_ACTIVE_QUESTIONS_SUCCESS',
    GET_INACTIVE_QUESTIONS_REQUEST: 'GET_INACTIVE_QUESTIONS_REQUEST',
    GET_INACTIVE_QUESTIONS_SUCCESS: 'GET_INACTIVE_QUESTIONS_SUCCESS',
    GET_WAITING_QUESTIONS_REQUEST: 'GET_WAITING_QUESTIONS_REQUEST',
    GET_WAITING_QUESTIONS_SUCCESS: 'GET_WAITING_QUESTIONS_SUCCESS'
};

export function getActiveQuestions(payload) {
    return { type: actionTypes.GET_ACTIVE_QUESTIONS_REQUEST, payload };
}

export function getActiveQuestionsSuccess(payload) {
    return { type: actionTypes.GET_ACTIVE_QUESTIONS_SUCCESS, payload };
}

export function getInactiveQuestions(payload) {
    return { type: actionTypes.GET_INACTIVE_QUESTIONS_REQUEST, payload };
}

export function getInactiveQuestionsSuccess(payload) {
    return { type: actionTypes.GET_INACTIVE_QUESTIONS_SUCCESS, payload };
}

export function getWaitingQuestions(payload) {
    return { type: actionTypes.GET_WAITING_QUESTIONS_REQUEST, payload };
}

export function getWaitingQuestionsSuccess(payload) {
    return { type: actionTypes.GET_WAITING_QUESTIONS_SUCCESS, payload };
}
